import React, { Component } from "react";
class BidItemListRow extends Component {
  state = {};
  render() {
    const { item, index } = this.props;
    return (
      <tr role="row">
        <td>{`000`}</td>
        <td>Mobile</td>
        <td>iPhone X </td>
        <td>
          <span class="badge badge-primary f-14">10 Unit</span>
        </td>
        <td>500.00 USD</td>
        <td>5000.00 USD</td>
      </tr>
    );
  }
}

export default BidItemListRow;
